import axios from 'axios';
// const { REACT_APP_API_KEY } = process.env;

const URL = 'https://cloud.iexapis.com/stable/stock';
// const API = process.env.REACT_APP_API_KEY;


class PolygonModel {
    static search = (query) => {
      return axios.get(`${URL}/${query}/quote?token=pk_b6f095f4e3bd490fb605c071ec8ba242`)
    }
}

export default PolygonModel;

// https://cloud.iexapis.com/stable/stock/XOM/quote?token=pk_b6f095f4e3bd490fb605c071ec8ba242
